import React from 'react'



const Filter = () => {
  return (
    <div>
        Filter
      <div className="row"> 
          <TextInput
            style={styles.input}
            placeholder='Filter'
            value={search.names}
            onChange={(e) => {
              setSearch(e.target.value)
              console.log(e.target.value)
            }}
            /> 

            <button>
              <AiOutlineSearch  />
            </button> 
         </div>  
         </div>
  )
}

export default Filter
